import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';

const button = <button>Sdasd</button>

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />

  </React.StrictMode>
);

ReactDOM.render (button, document.querySelector('#root'));
ReactDOM.render (button, document.querySelector('#root2'));
ReactDOM.render (button, document.querySelector('#root3'));
